    setRouteDetails(prev =>({ ...prev, [e.target.name]: e.target.value }))
    }

    clickHandler = (e) => {
        e.preventDefault();

        axios.post("http://localhost:8080/admin/route-details/post", this.state)
            .then(
                response => {
                    console.log(response.data)
                }
            ).catch(
                error => {
                    console.log(error)
                }
            )
    }




