                            <label htmlFor='text'>Station Id</label><br></br>
                            <input  type={"text"} placeholder="station Id.." name='stationId' value={stationId} onChange={this.changeHandler} required ></input><br></br><br></br>
                        </div>
                        <div >
                            <label htmlFor='text'>Arraival Time</label><br></br>
